import React from 'react'
import Grid from "@material-ui/core/Grid";
import CompositionCard from "./CompositionCard";
import styled from 'styled-components'
import Container from "@material-ui/core/Container";

const CompListContainer = styled(Container)`
        padding-top: ${({theme}) => theme.spacing(8)};
        padding-bottom: ${({theme}) => theme.spacing(8)};
`

function CompositionList({compositions = '', ...props}) {
    const compositionNodes = compositions ?
        compositions.map(compInfo => <CompositionCard key={compInfo.id} info={compInfo}/>) :
        <div>Не найдено ни одной композиции...</div>

    return (
        <CompListContainer maxWidth="xl">
            <Grid container spacing={2}>
                {compositionNodes}
            </Grid>
        </CompListContainer>
    );
}

export default CompositionList
